import { BrowserRouter, Route, Routes } from "react-router-dom";
import Authorization from "./components/Autorization/Authorization";

function App() {
  return (
      <BrowserRouter>
          <div className="App">
            <Routes>
              <Route path="/authorization"><Authorization/></Route>
            </Routes>
        </div>
      </BrowserRouter>
  );
}

export default App;
